15個の白色LEDバルブがライセンスプレートを鮮やかに照らします。純正のライセンスランプを取り外し、商品と交換するだけと、作業もとても簡単。キャンセラー内蔵で球切れ警告灯の誤作動を防止します。ハロゲンタイプのソケットとLEDタイプのソケットの2種類のソケットが用意されてる為、年式やモデルによるソケットの違いも心配が不要です。<br><br><br><br>ウェッジ球のみLEDに交換しても、発光にムラができ一部しか照らさなかったり純正時よりも暗くなってしまうといった問題が生じますが、ユニット交換タイプはレンズ面からナンバーに向かって直接照射するようにLEDが配置されており明るさ、発光範囲ともに段違いです。<br><br><br><br>●2個セット ●キャンセラー内臓 ●専用ハーネス付属 ※BMW品番：63 31 6 972 605/63 31 6 961 999/63 31 6 902 911/63 31 6 962 009<br><br><br><br>適合車種：E82/88 1シリーズ・E90～93 3シリーズ・E39/60/61 5シリーズ・E84 X1・E70 X5・E71 X6<br><br><br><br>車検対応品<tr><td colspan="2">
